import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';

// react router
import { Link, BrowserRouter, Route, Routes } from 'react-router-dom';
// pages
import Home from './Home';
import About from './About';
import Music from './Music';
import Live from './Live';
import Buy from './Buy';
import Contact from './Contact';


const App = () => {
return (
    <>
        <BrowserRouter>

    <div className='Navandtitle'>
         <img src={require("./mite-portrait.png")} className="portrait" />

           <div className='Main-banner-background'>

          <h1 className='Title'>mite</h1>
                                                <div className='background-title'>                  



           </div>
        <nav className='Nav'>
                    <Link to="/" className='Navbar-link'>Home</Link>
                     <Link to="/About" className='Navbar-link'>About</Link>
                    <Link to="/Music" className='Navbar-link'>Music</Link>
                    <Link to="/Live" className='Navbar-link'>Live</Link>
                    <Link to="/Buy" className='Navbar-link'>Buy</Link>
                    <Link to="/Contact" className='Navbar-link'>Contact</Link>



        </nav>
</div>



    </div>

    <Routes>
<Route  path="/" element={<Home />} >
</Route>
<Route  path="about/" element={<About />}>
</Route>
<Route  path="music/" element={<Music />}>
</Route>
<Route  path="live/" element={<Live />}>
</Route>
<Route  path="buy/" element={<Buy />}>
</Route>
<Route  path="contact/" element={<Contact />}>
</Route>
</Routes>
</BrowserRouter>
</>
)
};

export default App;
